import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

// User components
import UserRegister from "./components/User/UserRegister";
import UserLogin from "./components/User/UserLogin";
import UserProfile from "./components/User/UserProfile";
import UserList from "./components/User/UserList";
import UserRoleUpdate from "./components/User/UserRoleUpdate";

// Supplier components
import SupplierList from "./components/Supplier/SupplierList";
import SupplierAdd from "./components/Supplier/SupplierAdd";
import SupplierEdit from "./components/Supplier/SupplierEdit";
import SupplierDelete from "./components/Supplier/SupplierDelete";

// Product components
import ProductList from "./components/Product/ProductList";
import ProductAdd from "./components/Product/ProductAdd";
import ProductEdit from "./components/Product/ProductEdit";
import ProductDelete from "./components/Product/ProductDelete";

// Order components
import OrderList from "./components/Order/OrderList";
import OrderPlace from "./components/Order/OrderPlace";
import OrderDetail from "./components/Order/OrderDetail";
import OrderStatusUpdate from "./components/Order/OrderStatusUpdate";

function App() {
  return (
    <Router>
      <div className="App" style={{ padding: 16 }}>
        <nav>
          <Link to="/users/register">Register</Link>{" | "}
          <Link to="/users/login">Login</Link>{" | "}
          <Link to="/users/list">User List</Link>{" | "}
          <Link to="/products/list">Product List</Link>{" | "}
          <Link to="/products/add">Add Product</Link>{" | "}
          <Link to="/suppliers/list">Supplier List</Link>{" | "}
          <Link to="/suppliers/add">Add Supplier</Link>{" | "}
          <Link to="/orders/list">Order List</Link>{" | "}
          <Link to="/orders/place">Place Order</Link>
        </nav>
        <Routes>
          {/* User routes */}
          <Route path="/users/register" element={<UserRegister />} />
          <Route path="/users/login" element={<UserLogin />} />
          <Route path="/users/profile/:userId" element={<UserProfile />} />
          <Route path="/users/list" element={<UserList />} />
          <Route path="/users/role-update/:userId" element={<UserRoleUpdate />} />

          {/* Supplier routes */}
          <Route path="/suppliers/list" element={<SupplierList />} />
          <Route path="/suppliers/add" element={<SupplierAdd />} />
          <Route path="/suppliers/edit/:supplierId" element={<SupplierEdit />} />
          <Route path="/suppliers/delete/:supplierId" element={<SupplierDelete />} />

          {/* Product routes */}
          <Route path="/products/list" element={<ProductList />} />
          <Route path="/products/add" element={<ProductAdd />} />
          <Route path="/products/edit/:productId" element={<ProductEdit />} />
          <Route path="/products/delete/:productId" element={<ProductDelete />} />

          {/* Order routes */}
          <Route path="/orders/list" element={<OrderList />} />
          <Route path="/orders/place" element={<OrderPlace />} />
          <Route path="/orders/detail/:orderId" element={<OrderDetail />} />
          <Route path="/orders/status-update/:orderId" element={<OrderStatusUpdate />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
